import React from "react";
import { Line, Bar } from "react-chartjs-2";
import "../../styles/Chart.css";
const Presentation = (props) => {
  const { dailyData } = props;
  const lineChat = dailyData[0] ? (
    <Line
      data={{
        labels: "",
        datasets: [{}, {}],
      }}
    />
  ) : null;
  return (
    <div>
      <p>Presentation</p>
    </div>
  );
};
export default Presentation;
